/*!50003 CREATE */ /*!50017 DEFINER=`root`@`localhost` */ /*!50003 TRIGGER `tr_calculate_amount` BEFORE INSERT ON `tb_travel` FOR EACH ROW BEGIN
    DECLARE distanciConBmeficio DECIMAL (18,2);
    DECLARE distanciNoBeneficio DECIMAL (18,2);
  
    DECLARE montoConBmeficio DECIMAL (18,2);
    DECLARE montoNoBeneficio DECIMAL (18,2);
    DECLARE priceDitanceCompanyAUX DECIMAL (18,2);
    DECLARE inicio INT DEFAULT 0;
    DECLARE totalBenefiKm INT DEFAULT 0;
    DECLARE fromBeneficKm DECIMAL (18,2);
    DECLARE toBeneficKm DECIMAL (18,2);
    DECLARE amountBeneficKm DECIMAL (18,2);
    DECLARE distanciConBmeficioParticular DECIMAL (18,2) DEFAULT 0;
    DECLARE montoConBmeficioParticular DECIMAL (18,2) DEFAULT 0;
    DROP TEMPORARY TABLE IF EXISTS benefits_rang;
    SET priceDitanceCompanyAUX = (SELECT priceDitanceCompany FROM tb_company WHERE `idClientKf` = new.idClientKf);
    IF (SELECT VALUE FROM tb_sys_param WHERE idParam = 41) = 1 THEN 
        IF new.duration > (SELECT VALUE FROM tb_sys_param WHERE idParam = 42)*60 THEN 
           SET priceDitanceCompanyAUX =  (SELECT VALUE FROM tb_sys_param WHERE idParam = 43);
        END IF;
    END IF;
    IF (SELECT benefitsPerTime FROM tb_company WHERE `idClientKf` = new.idClientKf) = 1 THEN
        IF new.duration > (SELECT benefitsFromTime FROM tb_company WHERE `idClientKf` = new.idClientKf)*60   THEN 
            SET priceDitanceCompanyAUX =  (SELECT benefitsPreceTime FROM tb_company WHERE `idClientKf` = new.idClientKf);
        END IF;
    END IF;
    
    
    IF new.isTravelComany = 0 THEN /*viaje a cliente particular*/
      IF (SELECT VALUE FROM tb_sys_param WHERE idParam = 57) != "null" THEN /*VALIDACION PARA LOS BENEFICIOS POR KM*/
          CREATE TEMPORARY TABLE benefits_rang AS (
              SELECT * 
              FROM tb_benefitsperkm 
              WHERE idBenefitKmFk = (SELECT VALUE FROM tb_sys_param WHERE idParam = 57)
          );
          SET totalBenefiKm = (SELECT COUNT(*) FROM tb_benefitsperkm WHERE idBenefitKmFk = (SELECT VALUE FROM tb_sys_param WHERE idParam = 57));
          IF (totalBenefiKm > 0) THEN
              WHILE inicio < totalBenefiKm DO
                SELECT
                   benefits_rang.BenefitsFromKm INTO fromBeneficKm 
                FROM benefits_rang ORDER BY benefits_rang.BenefitsToKm DESC LIMIT 1;
                SELECT
                   benefits_rang.BenefitsToKm INTO toBeneficKm 
                FROM benefits_rang ORDER BY benefits_rang.BenefitsToKm DESC LIMIT 1;
                SELECT
                   benefits_rang.BenefitsPreceKm INTO amountBeneficKm 
                FROM benefits_rang ORDER BY benefits_rang.BenefitsToKm DESC LIMIT 1;
                IF((new.distance >= fromBeneficKm && new.distance >= toBeneficKm) || (new.distance >= fromBeneficKm && new.distance <= toBeneficKm)) THEN
                  
                  SET distanciConBmeficioParticular = distanciConBmeficioParticular + ( toBeneficKm - fromBeneficKm);
                  SET montoConBmeficioParticular = montoConBmeficioParticular + ( toBeneficKm - fromBeneficKm)*amountBeneficKm;
                END IF;
                DELETE FROM benefits_rang ORDER BY benefits_rang.BenefitsToKm DESC LIMIT 1;
          
                SET inicio = inicio + 1;
              END WHILE; 
              IF (montoConBmeficioParticular > 0 && new.distance < 1) THEN
               SET new.amountCalculate = montoConBmeficioParticular; 
              ELSE
               SET new.amountCalculate = (new.distance-distanciConBmeficioParticular) * (SELECT VALUE FROM tb_sys_param WHERE idParam =1)+montoConBmeficioParticular; 
              END IF;
          ELSE
            SET new.amountCalculate = new.distance * (SELECT VALUE FROM tb_sys_param WHERE idParam =1);  
          END IF;
      ELSE
        SET new.amountCalculate = new.distance * (SELECT VALUE FROM tb_sys_param WHERE idParam =1);
      END IF;
    ELSEIF  new.isTravelComany = 1 THEN /*VIAJE A EMPRESA*/
      CASE WHEN   new.isTravelSms = 1  /*VIAJE A MENSAJERIA */
        THEN SET new.amountCalculate = new.distance * (SELECT IFNULL(priceTravelSms,0) FROM tb_company WHERE `idClientKf` = new.idClientKf) + new.amountBilingualDriver + new.amountOriginPac;
      ELSE 
        IF new.idTravelPredestiantionCompany > 0 THEN
          SET new.amountCalculate = (SELECT `pricePredestinationCom` FROM `tb_company_pre_destation` WHERE `idPredestinosCom` = new.idTravelPredestiantionCompany) + new.amountBilingualDriver + amountOriginPac;
        ELSE 
            IF new.isPointToPoint = 1 THEN /*punt a punto*/
                SET new.amountCalculate = (SELECT `pricePoint` FROM `tb_company_travel_point_to_point` WHERE `idPoint` = new.idPointKf) + new.amountBilingualDriver + new.amountOriginPac;
            ELSE 
              IF (SELECT benefitsPerKm FROM tb_company WHERE `idClientKf` = new.idClientKf) = 1 THEN /* BENEFICIO POR KILIMETRO*/
                  IF(new.distance >= (SELECT benefitsFromKm FROM tb_company WHERE `idClientKf` = new.idClientKf) && new.distance >= (SELECT benefitsToKm FROM tb_company WHERE `idClientKf` = new.idClientKf)) THEN
                    SET distanciConBmeficio = (SELECT (benefitsToKm-benefitsFromKm) FROM tb_company WHERE `idClientKf` = new.idClientKf);
                    SET distanciNoBeneficio = new.distance - distanciConBmeficio;
                    SET montoNoBeneficio = distanciNoBeneficio * priceDitanceCompanyAUX;
                    SET montoConBmeficio = distanciConBmeficio * (SELECT benefitsPreceKm FROM tb_company WHERE `idClientKf` = new.idClientKf);
                    SET new.amountCalculate = montoNoBeneficio + montoConBmeficio + new.amountOriginPac;
                  ELSE 
                    SET new.amountCalculate = new.distance * priceDitanceCompanyAUX + new.amountBilingualDriver + new.amountOriginPac;
                END IF;
               ELSE 
                    SET new.amountCalculate = new.distance * priceDitanceCompanyAUX + new.amountBilingualDriver + new.amountOriginPac;
              END IF; 
            END IF;
        END IF; 
      END CASE;
    END IF;
    
    
    IF (SELECT VALUE FROM tb_sys_param WHERE idParam = 46) = 1 THEN 
        IF new.dateTravel < NOW() THEN 
           SET new.idSatatusTravel =  6;
        END IF;
    END IF;
    
    IF ((TIMESTAMPDIFF(MINUTE, NOW(), new.dateTravel))>=(SELECT VALUE FROM tb_sys_param WHERE idParam = 34)||(SELECT VALUE FROM tb_sys_param WHERE idParam = 34)<2) THEN 
        SET new.idTypeTravelKf = 2;
    END IF;
  
  
  END */;;
