/*!50003 CREATE */ /*!50017 DEFINER=`root`@`localhost` */ /*!50003 TRIGGER `tr_calculate_total_amount` BEFORE UPDATE ON `tb_travel` FOR EACH ROW BEGIN
SET @activeRate = (SELECT tb_sys_param.value FROM tb_sys_param WHERE idParam = 27);
SET @valueRate = (SELECT tb_sys_param.value FROM tb_sys_param WHERE idParam = 28);
SET @activePorReservation = (SELECT tb_sys_param.value FROM tb_sys_param WHERE idParam = 31);
SET @valuePorReservation= (SELECT tb_sys_param.value FROM tb_sys_param WHERE idParam = 32);
IF new.idSatatusTravel = 6 THEN /*VIAJE A FINALIZAR*/
       
        -- CAMBIOS DE PRECIO POR KM CON %
       IF new.idTypeTravelKf = 2 THEN
       IF @activeRate = 1 THEN
       SET new.percentageDif = @valueRate;
       SET new.amountGpsDif = new.amountGps+(new.amountGps*(@valueRate/100));
       END IF;
       IF @activePorReservation = 1 THEN
       SET new.percentageReservation = @valuePorReservation;
       END IF;
       END IF;
       
       SET new.totalAmount = 
       IFNULL(new.amountGps,0) + 
       IFNULL(new.amountTiemeSlepp,0) + 
       IFNULL(new.amounttoll,0) +
       IFNULL(new.amountBilingualDriver,0)+
       IFNULL(new.amountParking,0);
       
       IF new.idTypeTravelKf = 2 THEN
       SET new.totalAmount =
       IFNULL(new.totalAmount,0)+
       (IFNULL(new.totalAmount,0)*IFNULL(new.percentageReservation,0))/100;
       END IF;
       
       /*MONTOS ESPECIFICO PARA TARIFA DIFERENCIAL DE CHIFER*/
       SET new.totalAmountDR = 
       IFNULL(new.amountGpsDR,0) + 
       IFNULL(new.amountTiemeSleppDR,0) + 
       IFNULL(new.amounttollDR,0) +
       IFNULL(new.amountBilingualDriverDR,0)+
       IFNULL(new.amountParking,0);
       
       SET new.dateDriverFinish =  NOW();
       
       
       /*GUARDANDO EL RECORD DEL VIAJE CUANDO HA SIDO EDITADO*/
       /*IF new.isEdited = 1 THEN
         amountTiemeSleppTR, amounttollTR, 
         amountParkingTR, timeSleppGpsTR, 
         idTravelKfTR, idUserKfTR, totalAmountTR)
       VALUES (new.amountGps, new.distanceGps, 
         new.amountTiemeSlepp, new.amounttoll, 
         new.amountParking, new.timeSleppGps, 
         new.idTravel, new.idUserLatestEdited, new.totalAmount);
       END IF;*/
       
       ELSEIF  new.idSatatusTravel = 2 THEN 
       SET new.dateSendTravelFromDriver =  NOW();
       ELSEIF  new.idSatatusTravel = 4 THEN 
       SET new.dateDriverAcept =  NOW();
       ELSEIF  new.idSatatusTravel = 5 THEN 
       SET new.dateStartDriver =  NOW();
       END IF;
       END */;;
DELIMITER ;
